import React from "react";

function Product({ item }, children) {
  return (
    <div>
      {item.map(({ images }) => {
        <a href={`/shop/${item.category}/${item.id}`}>
          <img src={images.front} alt={item.item_name} />
          {children}
        </a>;
      })}
    </div>
  );
}
export default Product;
